import React from "react";
import "./style.css";

function Sorting(props) {
    return(
        <select className="selector">
            <option value="audi">Sort By Name</option>
            <option value="volvo">Sort By Age</option>
           <option onChange = {this.sortingByEmployeeFileNumber}>Sort By Employee File Number</option>
           <option value="mercedes">Sort By Office</option>
     </select>
    )
}

  export default Sorting;
